syntax = "proto2";

package ostorlab.agent.message.proto.v3.fingerprint.file.ios.library;

message Message {
  optional string path = 1;
  required string bundle_id = 2;
  optional string library_name = 3;
  optional string library_version = 4;
  optional string library_type = 5;
  optional string detail = 6;
}
